import React from "react";

let peticion= function Peticion(){

    const [datos, setData]= React.useState('');

    let url='http://localhost:8000/mysql/'

    React.useEffect(()=> {
        async function leer() {
        const response = await fetch(url, {
          method: 'GET',
        });
        const data = await response.json();
      
        return setData(await data)
      }
      leer()
    },[])
    return datos;

}
export default peticion
